import { VictoryLine, VictoryChart } from "victory";
import { bgColor3e } from "../../Styles/backGroundColor";

export function DefaultLineChart(props){
    const {border="10px solid #ccc", data=[ { x: 1, y: 2 }, { x: 2, y: 3 }, { x: 3, y: 5 }, { x: 4, y: 4 }, { x: 5, y: 7 } ],
            interpolation="basis", bg=bgColor3e} = props

    return (
    <VictoryChart minDomain={{ y: 0 }} style={{background: { fill:bg}}}>
        <VictoryLine 
            animate={{
                duration: 2000,
                onLoad: { duration: 2000 }}}
            style={{data: {stroke:props.lineColor, parent: { border:{border}}}}}
            interpolation={interpolation}
            data={data}/>
    </VictoryChart>)
}
